import React from 'react';
import logo from '../logo.svg';
import mineIcon from '../mine_icon.png';
import './App.css';

const App = () => {
  return (
    <div className="App">
      <header className="App-header">
        <img src={mineIcon} className="App-logo" alt="logo" />
        <p>
          CLICK TO START
        </p>
      </header>
    </div>
  );
}

export default App;
